
(document.body).on("click",".xj_search",function(h){var e=$(this).parents("form:first");var f=$(e).attr("action");var g=new FormData();$(".xj_searchitem").each(function(a){g.append($(this).attr("name"),$(this).val())});$.ajax({url:f,type:"POST",contentType:false,processData:false,data:g,success:function(a){document.open("text/html","replace");document.write(a);document.close();return true}})});